      <Container>
        <Hero>
          <HeroBody isColor="info" isSize='medium'>
            <Container hasTextAlign='centered'>
              <Title>Title</Title>
            </Container>
          </HeroBody>
        </Hero>
      </Container>
    )
  }
}
